// stores/imageStore.js
import { defineStore } from 'pinia';

export const useImageStore = defineStore('imageStore', {
  state: () => ({
    ImagenFondoVerde: 'data:image/png;base64,', 
    ImagenLogoQuchooch: 'data:image/png;base64,'
  }),
  actions: {
    setImageUrl(url) {
      this.ImagenFondoVerde = url; // Asigna la URL Base64
    },
    clearImageUrl() {
      this.ImagenFondoVerde = ''; // Limpia la URL si es necesario
    }
  },
});
